import React, { Component } from 'react';
import {Button, FormGroup, FormControl, ControlLabel, Grid, Row, Col, Tooltip, OverlayTrigger} from 'react-bootstrap';
import './../../resources/styles/style.css';
import './Config.css';
import Label from './../../components/Label.js';
import TextBox from './../../components/TextBox.js';
import {Animated} from "react-animated-css";
import Iframe from 'react-iframe';
import Header from './../../components/Header.js';

class Config extends Component {
  constructor(props) {
    super(props);

    this.state={isReportActive:false, isManageUserActive:false};
    this.onHeaderButtonsClick = this.onHeaderButtonsClick.bind(this);
  }

  onHeaderButtonsClick(event)
  {
    console.log(event.target.name);
    if(event.target.name == "logout")
    {
      this.props.history.push('/');
    }
  }


  render() {
    return (
        <div className="background">
          <Header text="Hello Admin How are you today ?" onClick={this.onHeaderButtonsClick}/>

          <div className="navBar">
            <div className="navBarPanel">
              <div className="navBarPanelButton"><img src={require('./../../resources/images/singtel-logo.png')} className="navPanelLogo" name="report"/></div>

              <div className={this.state.active ? 'navBarPanelButton': 'navBarPanelButton'}><img src={require('./../../resources/images/manage_report.png')} className="navPanelIcon" name="report"/>Manage Reports</div>
              <div className={this.state.active ? 'navBarPanelButton': 'navBarPanelButton'}><img src={require('./../../resources/images/team.png')} className="navPanelIcon" name="report"/>Manage Users</div>
            </div>
            <div className="navBarWindow">

            </div>
          </div>

        </div>
    );
  }
}

export default Config;
